import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import './MapView.css';

const MapView = () => {
  return (
    <MapContainer center={[39.1031, -84.5120]} zoom={13} className="map-container">
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution="&copy; OpenStreetMap contributors"
      />
      <Marker position={[39.1031, -84.5120]}>
        <Popup>
          Location Name <br /> Accessibility Rating: 4/5
        </Popup>
      </Marker>
    </MapContainer>
  );
};

export default MapView;
